import React, { useEffect, useState } from "react";
import images from './img.js';
import axios from 'axios';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { FormControl, InputLabel, Select, MenuItem, Button, Grid, Card, CardContent, Typography } from "@mui/material";
import Comment from './comment.js';

function Choise() {
  const [reviews, setReviews] = useState([]);
  const [overallRating, setOverallRating] = useState(0);
  const [courtConditionRating, setCourtConditionRating] = useState(0);
  const [ringsConditionRating, setRingsConditionRating] = useState(0);
  const [comment, setComment] = useState('');
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const path_to_avatar = "http://example.com/path/to/avatars";

  useEffect(() => {
    const fetchReviews = async () => {
      try {
        const response = await axios.get('');
        if (Array.isArray(response.data)) {
          setReviews(response.data);
        } else {
          console.error('Fetched data is not an array:', response.data);
          setReviews([]);
        }
      } catch (error) {
        console.error('Error fetching reviews:', error);
        setReviews([]);
      }
    };
    fetchReviews();
  }, []);

  const submitReview = async (e) => {
    e.preventDefault();
    if (!comment || overallRating === 0 || courtConditionRating === 0 || ringsConditionRating === 0 || !date || !time) {
      alert("Пожалуйста, заполните все поля!");
      return;
    }

    const newReview = { /* ... */ };

    try {
      await axios.post('', newReview);
      setReviews([...reviews, newReview]);
      setOverallRating(0);
      setCourtConditionRating(0);
      setRingsConditionRating(0);
      setComment('');
      setDate('');
      setTime('');
      toast.success("Отзыв успешно отправлен!");
    } catch (error) {
      console.error('Error submitting review:', error);
      toast.error("Ошибка при отправке отзыва.");
    }
  };

  return (
    <div className="container">
      <Grid container spacing={2}>
        <Grid item xs={6}>
          <img src="https://открыватор.москва/file/2015/10/karta-moskvi.jpg" height="180px" width="250px" />
        </Grid>
        <Grid item xs={6}>
          <Card variant="outlined">
            <CardContent>
              <Typography variant="h5">Набережная</Typography>
              <Typography variant="body2">
                <img src={images.point} height="23px" width="23px" /> Адрес:
              </Typography>
              <Button variant="contained" color="success">Я приду</Button>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
      <br />
      <form onSubmit={submitReview}>
        <FormControl fullWidth variant="outlined" margin="normal">
          <InputLabel>Дата</InputLabel>
          <Select
            value={date}
            onChange={(e) => setDate(e.target.value)}
            required
          >
            {/* Добавьте варианты для выбора даты */}
          </Select>
        </FormControl>
        <FormControl fullWidth variant="outlined" margin="normal">
          <InputLabel>Время</InputLabel>
          <Select
            value={time}
            onChange={(e) => setTime(e.target.value)}
            required
          >
            {/* Добавьте варианты для выбора времени */}
          </Select>
        </FormControl>
        <Comment
          reviews={reviews}
          overallRating={overallRating}
          setOverallRating={setOverallRating}
          courtConditionRating={courtConditionRating}
          setCourtConditionRating={setCourtConditionRating}
          ringsConditionRating={ringsConditionRating}
          setRingsConditionRating={setRingsConditionRating}
          comment={comment}
          setComment={setComment}
          submitReview={submitReview}
        />
      </form>
      <ToastContainer />
    </div>
  );
}

export default Choise;
